        <section class="exc-hero-section">
            <div class="container">
                <div class="exc-container">
                                            <div class="exc-video">
                            <video autoplay='autoplay' loop='loop' muted playsinline  oncontextmenu='return false;'  preload='auto' src='https://player.vimeo.com/progressive_redirect/playback/994892980/rendition/1080p/file.mp4?loc=external&signature=b04ab5ef04ba1e81c3eb5535668974c29b23eba3b2f66b28fd38e19ab2064879'>Your browser does not support the video tag.</video>                        </div>
                                        <div class="exc-title">
                        <h1>Cable Tricep Kickbacks</h1>
                    </div>
                    <div class="social mr-bottom-20">
                        <p class="has-small-font-size pri-color-2" style="margin-bottom: 0">Follow us: </p>
                                                        <a target="_blank" href="#"><img alt="facebook"
                                        src="https://www.endomondo.com/wp-content/uploads/2024/01/facebook.svg" /></a>
                                                            <a target="_blank" href="https://www.youtube.com/@workoutendomondo"><img alt="youtube"
                                        src="https://www.endomondo.com/wp-content/uploads/2024/01/youtube.svg" /></a>
                                                            <a target="_blank" href="https://www.instagram.com/workoutendomondo/"><img alt="instagram"
                                        src="https://www.endomondo.com/wp-content/uploads/2024/01/instagram-2-1.svg" /></a>
                                                            <a target="_blank" href="https://www.pinterest.com/endomondo/"><img alt="pinterest"
                                        src="https://www.endomondo.com/wp-content/uploads/2024/01/pinterest-1.svg" /></a>
                                                            <a target="_blank" href="https://www.newsbreak.com/m/endomondo-305644568"><img alt="newsbreak"
                                        src="https://www.endomondo.com/wp-content/uploads/2025/01/svgexport-2-2-1.svg" /></a>
                                                </div>
                    <div class="exc-description">
                        <p><span style="font-weight: 400;">Our arms are a star player on the list of what makes an impressive physique. Common exercises like the bench press receive quite the notoriety for building a strong upper body.</span></p><p><span style="font-weight: 400;">Cable tricep kickbacks can also be useful for building the upper body. This exercise can increase strength, tone, and performance in your arms. The tricep kickback isolates the </span><a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC5827912/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">triceps</span></a><span style="font-weight: 400;"> under resistance and trains the entire arm. </span></p><p><span style="font-weight: 400;">In this guide, you will learn how to perform this exercise correctly and implement it into your workouts. You will discover the benefits of this high-value exercise as well.</span></p>                    </div>
                </div>
            </div>
        </section>

                <section class="exc-content">
            <div class="container">
                <div class="exc-container">
                                                                                                        <div class="content-item bd-bot exercise-list-start">
                                    <h2 class="title-content">How To Do</h2>
                                    <ol><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Find an open cable pulley machine and hook a single handle attachment to one of the cable arms.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Adjust the height of the arm to about mid-thigh level and grab the handle with a palms-down grip.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Choose a weight that allows you to fully extend your elbow several times consecutively.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">You will need to use a bench for placement of the nonlifting side’s arm and leg.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Set up into a forward lean with the knee and same side hand on a bench. Your knee should be bent and placed under your hip. Your hand rests on the bench, slightly in front of the shoulder joint. This is the side that isn’t pulling against the resistance.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Set your standing leg extended down from your hip with your knee slightly bent. </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Rest your elbow of the lifting arm against your ribs and keep your back straight. Hold your elbow up to align with your back.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Maintain your forward lean and elbow position as you kick the arm back toward your hip. </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Control the arm movement as you move it back to the starting position. </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Repeat for the desired number of repetitions before changing positions to perform on the opposite side. </span></li></ol>                                                                    </div>
                                                                                                                                                            <div class="content-item bd-bot exercise-list-start">
                                    <h2 class="title-content">Tips From Expert</h2>
                                    <ul><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Do not twist your upper body during the movement; keep your shoulders leveled.</span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Try not to raise or lower your trunk, as the force for elbow extension should be solely through the arm muscles. </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">For a sufficient base of support, widen your feet to be at least a hip-width distance apart. </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">Make an effort to squeeze the tricep muscle at arm extension by trying to pause briefly.  </span></li><li style="font-weight: 400;" aria-level="1"><span style="font-weight: 400;">As your arm tires, try to prevent the elbow from leaving your side.</span></li><li>Prioritize this exercise when muscle fatigue may limit your compound lifts. Utilizing the cable tricep kickbacks maintains strength and prevents you from <a href="https://pubmed.ncbi.nlm.nih.gov/21509869/" target="_blank" rel="nofollow noopener">detraining</a>.</li><li aria-level="1">Target the triceps lateral head more by using a neutral wrist position during the cable tricep kickbacks. This better aligns the forearm bones with this muscle’s direct line of force.</li></ul>                                                                    </div>
                                                                                                                                                            <div class="content-item bd-bot exercise-list-start">
                                    <h2 class="title-content">Optimal Sets and Reps</h2>
                                    <p><span style="font-weight: 400;">The cable tricep kickback lines up very well with common strength goals, producing great results. See the table below for guidance on the ideal </span><a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7927075/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">sets and reps</span></a><span style="font-weight: 400;"> according to your goals.</span></p>                                                                                <div style="overflow: auto">
                                                <figure class="wp-block-table">
                                                    <table>
                                                        <thead>
                                                            <tr>
                                                                <th>Training Type</th>
                                                                <th>Sets</th>
                                                                                                                                    <th>Reps</th>
                                                                                                                            </tr>
                                                        </thead>
                                                        <tbody>
                                                                                                                            <tr>
                                                                                                                                                                                                                        <td>Strength Training</td>
                                                                                                                                                                                                                                                                                                <td>3–5</td>
                                                                                                                                                                                                                                                                                                <td>4–6</td>
                                                                                                                                                                                                                                                                                                                                                        </tr>
                                                                                                                            <tr>
                                                                                                                                                                                                                        <td>Hypertrophy</td>
                                                                                                                                                                                                                                                                                                <td>3–6</td>
                                                                                                                                                                                                                                                                                                <td>8–12</td>
                                                                                                                                                                                                                                                                                                                                                        </tr>
                                                                                                                            <tr>
                                                                                                                                                                                                                        <td>Endurance Training</td>
                                                                                                                                                                                                                                                                                                <td>3–4</td>
                                                                                                                                                                                                                                                                                                <td>15+</td>
                                                                                                                                                                                                                                                                                                                                                        </tr>
                                                                                                                            <tr>
                                                                                                                                                                                                                        <td>Power Training</td>
                                                                                                                                                                                                                                                                                                <td>3–5</td>
                                                                                                                                                                                                                                                                                                <td>1–5 (Explosive)</td>
                                                                                                                                                                                                                                                                                                                                                        </tr>
                                                                                                                    </tbody>
                                                    </table>
                                                    <figcaption class="wp-element-caption">Optimal Sets & Reps of Cable Tricep Kickbacks                                                    </figcaption>
                                                </figure>
                                            </div>
                                                                        </div>
                                                                                                                                                            <div class="content-item bd-bot exercise-list-start">
                                    <h2 class="title-content">How to Put in Your Workout Split</h2>
                                    <p><span style="font-weight: 400;">Cable tricep kickbacks can be approached in the same ways you would any strength exercise. It is not a compound lift (involving multiple joints), so loads will not be as high.</span></p><p><span style="font-weight: 400;">Here is how you can incorporate this exercise into commonly used variations on a </span><a href="https://www.endomondo.com/workouts/3-day-workout-split" target="_blank" rel="noopener"><span style="font-weight: 400;">3-day workout split</span></a><span style="font-weight: 400;">: </span><b></b></p><ul><li aria-level="1"><b>Upper/Lower — </b><span style="font-weight: 400;">The cable tricep kickbacks fit nicely as a compliment to upper body lifts. Perform this exercise as a lighter activation for your pressing movements. It can also easily work as an auxiliary exercise to round out workout volume. </span></li><li style="font-weight: 400;" aria-level="1"><b>Single Muscle Group —</b><span style="font-weight: 400;"> This approach is highlighted by a high workout frequency. Pair with similar upper body lifts. Since you are working the triceps and arms only once per week, using higher volumes is appropriate. </span></li><li aria-level="1"><b>Total Body — </b><span style="font-weight: 400;">If your program is designed to work your full body every day, these should be programmed no more than two to three times per week. On any day, the cable triceps kickbacks can work well here as a stand-alone movement. You can avoid over-training your compound lifts without sacrificing overall intensity. </span></li></ul>                                                                    </div>
                                                                                                                                                                                                                                                                                                                        </div>
            </div>
        </section>
                    <section class="exc-primary">
                <div class="container">
                    <div class="exc-container bd-bot">
                        <div class="muscle-title">
                            <h2>Primary Muscle Groups</h2>
                        </div>
                        <div class="muscle-list primary-muscle">
                                                            <div class="mucle">
                                    <div class="muscle-item">
                                        <div class="muscle-img">
                                            <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Lateral-Heads.png" alt="">
                                        </div>
                                        <p class="has-medium-font-size">Triceps Lateral Heads</p>
                                        <p class="has-small-font-size"><p>Muscles located on the back of your arm between your shoulder and elbow.</p></p>
                                    </div>
                                </div>
                                                            <div class="mucle">
                                    <div class="muscle-item">
                                        <div class="muscle-img">
                                            <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Medial-Heads.png" alt="">
                                        </div>
                                        <p class="has-medium-font-size">Triceps Medial Heads</p>
                                        <p class="has-small-font-size"><p>Small muscles located at the back of your arms. Deep to the triceps long heads between the shoulder and elbow.</p></p>
                                    </div>
                                </div>
                                                            <div class="mucle">
                                    <div class="muscle-item">
                                        <div class="muscle-img">
                                            <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Long-Heads.png" alt="">
                                        </div>
                                        <p class="has-medium-font-size">Triceps Long Heads</p>
                                        <p class="has-small-font-size"><p>Large muscles located at the back of your arms between your shoulder and elbow. Most outside portion of the tricep.</p></p>
                                    </div>
                                </div>
                                                    </div>
                    </div>
                </div>
            </section>
                            <div class="container">
                    <div class="exc-container">
                        <div class="muscle-text bd-bot exercise-list-start">
                            <h3><b>Triceps Medial Heads</b></h3><p><span style="font-weight: 400;">The medial head of the triceps covers the inner and back parts of the upper arm. It attaches from the upper humerus (arm bone) and inserts into the elbow. The main role of this muscle is to extend the elbow.</span></p><p><span style="font-weight: 400;">This muscle aids in extending the elbow during the cable tricep kickbacks. Studies have also shown that </span><a href="https://pubmed.ncbi.nlm.nih.gov/24990168/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">its activity</span></a><span style="font-weight: 400;"> can increase with fatigue. In other words, as the other parts of the triceps get tired, the medial head seems to increase its effort.</span></p><p><span style="font-weight: 400;">This shows the versatility of the triceps muscle group in performing challenging movements like cable kickbacks.</span></p><h3><b>Triceps Lateral Heads</b></h3><p><span style="font-weight: 400;">This triceps head is also on the rear upper arm but towards the outer part. Its attachments are from the upper humerus, behind the posterior deltoid, to the junction between the upper arm and forearm. </span></p><p><span style="font-weight: 400;">The lateral head of the triceps </span><a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC6136322/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">contributes strongly to elbow extension</span></a><span style="font-weight: 400;"> during the tricep kickback.</span></p><h3><b>Triceps Long Heads</b></h3><p><span style="font-weight: 400;">The long head of the triceps is on the inner back half of the upper arm. It is the inner part of the common horseshoe look that is used to describe the rear arm musculature. It attaches to the shoulder joint on the scapula (shoulder blade) and runs down to the inner elbow. </span></p><p><span style="font-weight: 400;">The long head of the triceps produces the greatest </span><a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC6136322/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">extension force</span></a><span style="font-weight: 400;"> when the elbow is closer to the body. Pushdowns are a great example of this, but the tricep kickback exercise is a great position for this muscle’s engagement as well. </span></p><p><span style="font-weight: 400;">This muscle works hard not only to extend the elbow but also to hold the shoulder in a neutral position at the trunk level. </span></p>                        </div>
                    </div>
                </div>
                                        <section class="exc-secondary">
                <div class="container">
                    <div class="exc-container bd-bot">
                        <div class="muscle-title">
                            <h2>Secondary Muscle Groups</h2>
                        </div>
                        <div class="muscle-list secondary-muscle">
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Wrist-Flexors.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Wrist Flexors</p>
                                    <p class="has-small-font-size"><p>Muscles that span the inside of your lower arm, between your elbow and wrist palm side up.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Wrist-Extensors.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Wrist Extensors</p>
                                    <p class="has-small-font-size"><p>Muscles that make up the back portion of your lower arm, between your elbow and wrist.</p></p>
                                </div>
                                                    </div>
                    </div>
                </div>
            </section>
                            <div class="container">
                    <div class="exc-container">
                        <div class="muscle-text bd-bot exercise-list-start">
                            <h3><b>Wrist Flexors</b></h3><p><span style="font-weight: 400;">Your wrist flexors are a group of muscles that make up part of your forearm. They work to flex your wrists and fingers. They run along the underside of the forearm from the inner elbow to the wrist and hand. </span></p><p><span style="font-weight: 400;">In terms of function, they enable a strong grip and provide control in movements such as lifting and holding. When performing the cable tricep kickbacks, they allow you to maintain a </span><a href="https://journals.lww.com/acsm-msse/fulltext/2018/11000/force_length_relationship_modeling_of_wrist_and.16.aspx" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">firm grip</span></a><span style="font-weight: 400;"> on the handle.</span></p><p><span style="font-weight: 400;">This is important in establishing stability in the lower arm so the upper arm can work to extend the elbow.</span></p><h3><b>Wrist Extensors</b></h3><p><span style="font-weight: 400;">The wrist extensors are the group of muscles tasked with lifting your hand and helping to raise the fingers. They attach from the outer elbow to the wrist and hand as they run across the top of your forearm. </span></p><p><span style="font-weight: 400;">During the cable tricep kickbacks, the wrist extensors contract to stabilize the wrist, but do not move it. They </span><a href="https://pubmed.ncbi.nlm.nih.gov/32803449/" target="_blank" rel="nofollow noopener"><span style="font-weight: 400;">activate</span></a><span style="font-weight: 400;"> alongside the wrist flexors to maintain a firm grip on the handle.</span></p><p><span style="font-weight: 400;">These extensors also stabilize the wrist in position so the force can efficiently be placed onto the triceps.</span></p>                        </div>
                    </div>
                </div>
                                        <section class="exc-equipment">
                <div class="container">
                    <div class="exc-container bd-bot">
                        <div class="muscle-title">
                            <h2>Equipment</h2>
                        </div>
                        <div class="equipment-container">
                            <div class="muscle-list equipment-list">
                                                                                                            <div class="equipment-item muscle-item">
                                            <div class="muscle-img">
                                                <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Flat-Bench-Without-Rack.png" alt="">
                                            </div>
                                            <p class="has-medium-font-size">Flat Bench Without Rack</p>
                                        </div>
                                                                                                                                                <div class="equipment-item muscle-item">
                                            <div class="muscle-img">
                                                <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Narrow-Cable-Pulley-Towers.png" alt="">
                                            </div>
                                            <p class="has-medium-font-size">Narrow Cable Pulley Towers</p>
                                        </div>
                                                                                                                                                <div class="equipment-item muscle-item">
                                            <div class="muscle-img">
                                                <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Rope-Attachment.png" alt="">
                                            </div>
                                            <p class="has-medium-font-size">Rope Attachment</p>
                                        </div>
